function openTrading() external {
    // Only the contract owner can call this function
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // Trading must not already be open
    require(!tradingOpen, "trading is already open");

    // Initialise the Uniswap router (v2 – 0x7a25…)
    IUniswapV2Router02 router = IUniswapV2Router02(
        0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
    );
    uniswapV2Router = router;

    // Create the trading pair for this token
    uniswapV2Pair = IUniswapV2Factory(router.factory()).createPair(
        address(this),
        router.WETH()
    );

    // Approve router for max uint256 so it can add / remove liquidity & swap
    _approve(address(this), address(router), type(uint256).max);

    // Add all tokens and any ETH held by the contract as liquidity
    router.addLiquidityETH{value: address(this).balance}(
        address(this),
        balanceOf(address(this)),
        0,                // accept any amount of tokens
        0,                // accept any amount of ETH
        owner(),          // send the LP tokens to the owner
        block.timestamp
    );

    swapEnabled  = true;
    tradingOpen  = true;
}

